/** @format */
import React from 'react';

function Nav() {
	return (
		<>
			<div className='px-14 py-6 bg-black text-white'>
				<h1 className='font-extrabold'>My Logo</h1>
				<div>
					<a>Project</a>
				</div>
			</div>
		</>
	);
}

export default Nav;
